  // Parse inputs
  const currentAge = Number(inputs.currentAge) || 30;
  const retirementAge = Number(inputs.retirementAge) || 65;
  const currentSavings = Number(inputs.currentSavings) || 0;
  const monthlyContribution = Number(inputs.monthlyContribution) || 0;
  const expectedReturn = Number(inputs.expectedReturn) / 100;
  const inflationRate = Number(inputs.inflationRate) / 100;
  const desiredIncome = Number(inputs.desiredIncome) || 0;
  const lifeExpectancy = Number(inputs.lifeExpectancy) || 90;
  
  // Calculate years until retirement and years in retirement
  const yearsToRetirement = retirementAge - currentAge;
  const yearsInRetirement = lifeExpectancy - retirementAge;
  
  // Calculate real rate of return (adjusted for inflation)
  const realReturnRate = (1 + expectedReturn) / (1 + inflationRate) - 1;
  
  // Project savings at retirement
  let projectedSavings = currentSavings;
  for (let i = 0; i < yearsToRetirement; i++) {
    projectedSavings = projectedSavings * (1 + expectedReturn) + (monthlyContribution * 12);
  }
  
  // Calculate required savings using the present value of an annuity formula
  // Assuming the desired income is in today's dollars
  const inflationAdjustedIncome = desiredIncome * Math.pow(1 + inflationRate, yearsToRetirement);
  
  // Using the formula for present value of an annuity
